import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { ResultComponent } from './result/result.component';
import { CoreModule } from '../core/core.module';



@NgModule({
  declarations: [
    ResultComponent
  ],
  imports: [
    CommonModule,
    CoreModule,
  ]
})
export class ResultModule { }
